import React from 'react';
import ReactDOM from 'react-dom/client';
import { ReactKeycloakProvider } from '@react-keycloak/web';
import { initKeycloak, getInitializationState } from './keycloak';
import App from './App';
import axios from 'axios';

// Configure axios defaults
axios.defaults.baseURL = 'http://localhost:8080';

// Ensure URL is a string
const ensureStringUrl = (url) => {
    if (typeof url === 'string') {
        return url;
    }
    if (url instanceof URL) {
        return url.toString();
    }
    if (typeof url === 'object' && url.origin) {
        return `${url.origin}${url.pathname || ''}`;
    }
    console.warn('Invalid URL format:', url);
    return window.location.origin;
};

const renderError = (error) => {
    const root = ReactDOM.createRoot(document.getElementById('root'));
    root.render(
        <div style={{
            padding: '20px',
            fontFamily: 'Arial',
            maxWidth: '800px',
            margin: '0 auto',
            textAlign: 'center'
        }}>
            <h1 style={{ color: '#d32f2f' }}>Authentication Service Unavailable</h1>
            <p>We're unable to connect to the authentication service.</p>

            <div style={{
                backgroundColor: '#ffebee',
                padding: '20px',
                borderRadius: '8px',
                margin: '20px 0',
                textAlign: 'left'
            }}>
                <h3>Error Details:</h3>
                <p><strong>Message:</strong> {error.message}</p>
                <p><strong>Details:</strong> {error.details}</p>
                <p><strong>Keycloak URL:</strong> {ensureStringUrl(error.config?.url) || 'Not available'}</p>
                <p><strong>Realm:</strong> {error.config?.realm || 'Not available'}</p>
                <p><strong>Client ID:</strong> {error.config?.clientId || 'Not available'}</p>
                <p><strong>Redirect URI:</strong> {ensureStringUrl(error.config?.redirectUri) || 'Not available'}</p>
                <p><strong>CORS Enabled:</strong> {error.config?.cors ? 'Yes' : 'No'}</p>
                <p><strong>CORS Origins:</strong> {error.config?.corsOrigins?.join(', ') || 'Not configured'}</p>
            </div>

            <div style={{
                backgroundColor: '#f5f5f5',
                padding: '20px',
                borderRadius: '8px',
                margin: '20px 0',
                textAlign: 'left'
            }}>
                <h3>Debug Information:</h3>
                <p><strong>Current Time:</strong> {new Date().toLocaleString()}</p>
                <p><strong>Window Origin:</strong> {window.location.origin}</p>
                <p><strong>Browser:</strong> {navigator.userAgent}</p>
                <p><strong>React App Port:</strong> 4200</p>
            </div>

            <div style={{
                backgroundColor: '#fff3e0',
                padding: '20px',
                borderRadius: '8px',
                margin: '20px 0',
                textAlign: 'left'
            }}>
                <h3>Keycloak Configuration Checklist:</h3>
                <ul style={{ listStyleType: 'disc', paddingLeft: '20px' }}>
                    <li>Keycloak server running at http://localhost:9090</li>
                    <li>Realm "whatsapp-clone" exists</li>
                    <li>Client "whatsapp-clone-app" exists</li>
                    <li>Client has "public" access type</li>
                    <li>Client has "http://localhost:4200/*" in Valid Redirect URIs</li>
                    <li>Client has "http://localhost:4200" in Web Origins</li>
                </ul>
            </div>

            <button
                onClick={() => window.location.reload()}
                style={{
                    padding: '12px 24px',
                    marginTop: '20px',
                    backgroundColor: '#1976d2',
                    color: 'white',
                    border: 'none',
                    borderRadius: '4px',
                    cursor: 'pointer',
                    fontSize: '16px'
                }}
            >
                Retry
            </button>
        </div>
    );
};

const initApp = async () => {
    try {
        console.log('Initializing application...');
        const keycloak = await initKeycloak();

        // Add request interceptor to handle auth
        axios.interceptors.request.use(async (config) => {
            if (keycloak.authenticated) {
                try {
                    await keycloak.updateToken(70);
                    config.headers.Authorization = `Bearer ${keycloak.token}`;
                } catch (error) {
                    console.error('Failed to refresh token:', error);
                    keycloak.login();
                }
            }
            return config;
        });

        const root = ReactDOM.createRoot(document.getElementById('root'));
        root.render(
            <ReactKeycloakProvider authClient={keycloak}>
                <App />
            </ReactKeycloakProvider>
        );
        console.log('Application initialized successfully');
    } catch (error) {
        console.error('Application initialization failed:', error);
        const state = getInitializationState();
        console.log('Keycloak initialization state:', state);
        renderError(error);
    }
};

initApp();
